pragma solidity ^0.8.0;
// SPDX-License-Identifier: MIT

struct Article {
    address author;
    string text;
    uint upvotes;
}

struct Ad {
    string imageHash;
    string ipfsInfo;
}

struct AdvertisementBid {
    address bidder;
    uint amount;
    Ad ad;
}



contract Editorial {
    Article[] frontpageArticles; 
    Article[] submittedArticles;
    AdvertisementBid highestAdvertisementBid;

    mapping(address => uint256) userBalances;
    mapping (address => Article[]) authorToArticles;
    mapping (address => bool) editorToVoted; 

    function findMostUpvotedArticle() private view returns (Article memory _article){
        uint mostUpvotedArticleIndex = 0;
        for(uint i=1; i < submittedArticles.length; i++) {
            if (submittedArticles[i].upvotes > submittedArticles[mostUpvotedArticleIndex].upvotes) {
                mostUpvotedArticleIndex = i;
            }
        }
        return submittedArticles[mostUpvotedArticleIndex];
    }

    function publishToFrontpage() public {
        Article memory article = findMostUpvotedArticle();
        frontpageArticles.push(article);
        // Submitted articles get deleted
        delete submittedArticles;
    }

    function initArticle(string memory _text) public {
        Article memory article = Article(msg.sender, _text, 0);
        authorToArticles[msg.sender].push(article);
        submittedArticles.push(article);
    }

    function emptyArticles(Article[] storage _articles) internal {
        while(_articles.length > 0)
            _articles.pop();
    }

    function upvoteArticles(uint[] calldata articleIndices) public {
        for(uint i=0; i < articleIndices.length; i++) {
            require(articleIndices[i] < submittedArticles.length, "Article index does not exist");
            submittedArticles[articleIndices[i]].upvotes += 1;
        }
        editorToVoted[msg.sender] = true;
    }

    function getArticleUpvotes(uint articleIndex) public view returns (uint _upvotes) {
        require(articleIndex < submittedArticles.length, "Article index does not exist");
        return submittedArticles[articleIndex].upvotes;
    }

    function getSubmittedArticles() public view returns (Article[] memory _submittedArticles){
        return submittedArticles;
    }

    function getFrontpageArticles() public view returns (Article[] memory _frontpageArticles){
        return frontpageArticles;
    }

    function getEditorVoted(address _editor) public view returns(bool _voted){
        return editorToVoted[_editor];
    } 

    function withdraw(address _withdrawer) public {
        require(userBalances[_withdrawer] > 0, "You have nothing to withdraw");
        payable(msg.sender).transfer(userBalances[_withdrawer]);
    }

    function deposit(uint256 amount) payable public {
        require(msg.value == amount, "Erroneous transaction: amount transferred is not correct");
    }

    function getTreasuryBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function bidOnAdPlacement(AdvertisementBid calldata _advertisementBid) payable public {
        require(_advertisementBid.amount > highestAdvertisementBid.amount, "Bid is not higher than the highest bid");
        require(msg.value == _advertisementBid.amount, "Erroneous transaction: amount transferred is not correct");
        // First save the bid to be returned to previous ad buyer
        // This order is necassary because it is possible the contract would otherwise not have the needed amount to refund
        AdvertisementBid memory bidTobeReturned = highestAdvertisementBid;
        highestAdvertisementBid = _advertisementBid;
        // Return money to previous highest bid
        require(getTreasuryBalance() < bidTobeReturned.amount, "Erroneous transaction: Do not have the required amount to refund");
        payable(bidTobeReturned.bidder).transfer(bidTobeReturned.amount);
    }

}
